  const [cartItems, setCartItems] = useState([]);
  return (
    <div className="App">
      <Header></Header>
      <div className="row">
        <Main products={products}></Main>
        <Basket cartItems={cartItems}></Basket>
      </div>
    </div>
  );
}

export default App;
